import React, { useState } from "react";
import { useNavigate } from "react-router-dom";
import "../../css/style.css";

const AdminDashboard = () => {
    const navigate = useNavigate();
    const [activeMenu, setActiveMenu] = useState("Manajemen Wisata");

    const renderContent = () => {
        switch (activeMenu) {
            case "Manajemen Wisata":
                return <h3>Kelola data wisata di sini.</h3>;
            case "Manajemen Lawa":
                return <h3>Kelola data Lawa di sini.</h3>;
            case "Manajemen Baluara":
                return <h3>Kelola data Baluara di sini.</h3>;
            default:
                return <h3>Selamat datang di Admin Dashboard.</h3>;
        }
    };

    return (
        <div className="admin-layout">
            {/* Sidebar Menu */}
            <div className="admin-sidebar">
                <h2>Admin Panel</h2>
                <ul>
                    <li onClick={() => setActiveMenu("Manajemen Wisata")}>Manajemen Wisata</li>
                    <li onClick={() => setActiveMenu("Manajemen Lawa")}>Manajemen Lawa</li>
                    <li onClick={() => setActiveMenu("Manajemen Baluara")}>Manajemen Baluara</li>
                </ul>
            </div>

            {/* Konten Dinamis */}
            <div className="admin-content">
                {renderContent()}
            </div>
        </div>
    );
};

export default AdminDashboard;
